import React from 'react';
import Home from './components/Home';
import Signup from './components/Signup';

function App() {
    return (


        <Router>
            <Switch>
                <Route exact path='/' component={Home} />

                <Route exact path='/signup' component={Signup} />

            </Switch>
        </Router>



    )
}

export default App;
